118.body:
Customize and enable notifications. Example [notifications]
highlight = { sound = "dong" }
direct_message = { sound = "peck", show_toast = true } Following notifications are available: Name Description connected Triggered when a server is connected direct_message Triggered when a direct message is received disconnected Triggered when a server disconnects file_transfer_request Triggered when a file transfer request is received highlight Triggered when you were highlighted in a buffer monitored_online Triggered when a user you're monitoring is online monitored_offline Triggered when a user you're monitoring is offline reconnected Triggered when a server reconnects

